#include <iostream>
#include <vector>
#include <unordered_map>
#include <string>

using namespace std;

class Solution
{
public:
    bool isOneEditDistance(string s, string t)
    {

        return editDistanceMemo(s, t) == 1;
    }
    // Recursive out Memory Limit Exceeded
    // Best case O(1)
    // Worst O(3 & N)
    int editDistance(string s, string t, int n, int m)
    {
        if (n == 0)
        {
            return m;
        }
        if (m == 0)
        {
            return n;
        }
        if (s[n - 1] == t[m - 1])
        {
            return editDistance(s, t, n - 1, m - 1);
        }
        return 1 + min(editDistance(s, t, n - 1, m),
                       min(editDistance(s, t, n, m - 1),
                           editDistance(s, t, n - 1, m - 1)));
    }
    int editDistanceMemo(string s, string t)
    {
        int memo[s.size() + 1][t.size() + 1];

        for (int i = 0; i <= s.size(); i++)
        {
            for (int j = 0; j <= t.size(); j++)
            {
                if (i == 0)
                {
                    memo[i][j] = j;
                }
                else if (j == 0)
                {
                    memo[i][j] = i;
                }
                else if (s[i - 1] == t[j - 1])
                {
                    memo[i][j] = memo[i - 1][j - 1];
                }
                else
                {
                    memo[i][j] = 1 + min(
                                         memo[i - 1][j],
                                         min(memo[i][j - 1],
                                             memo[i - 1][j - 1]));
                }
            }
        }
        return memo[s.size()][t.size()];
    }
};

int main()
{
    Solution s;
    cout << s.isOneEditDistance("",
                                "")
         << endl;
    return 0;
}